    email: "Zorahida@zorahida.com",
    password:"Hola"
}
 const Login = ({ LoginUser, LogError}) => {
    const location = useLocation()
    const { state } = location

const [form, setForm] = useState(prevState)
    const {register, handelSubmit, formState: {errors}} = userForm();
    
    const result = async(data) => {
        const res = await axios('http://localhost:3000/', data)
    }
    
    return (
        <div>
        <form onSubmit={handelSubmit(result)}>
            <input type= 'text' placeholder= 
            'name' {...register('name', {required: "Debes introducir tu nombre"})}
            />

            <input type='email' placeholder='Dejanos tu email'
            {...register('email')}
            />
    
            <button type='submit'> Enviar </button>
        </form>            
    
        </div>
    );
};
export default Form
